    <script  async defer>
      function Fibonacci(n)
      {
          if (n <= 1) {
              return n
          }
          var f1 = 0
          var f2 = 1
          var result = 0
          for (var i = 2; i <= n; i++) {
              result = f1 + f2
              f1 = f2
              f2 = result
          }
          return result
      }
    </script>
